		<item>
			<title><![CDATA[[Tool/Web/Other] samp03svr в Docker]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=664121</link>
			<pubDate>Tue, 19 Feb 2019 16:53:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=156495">SHOROOP</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=664121</guid>
			<description><![CDATA[Всем привет. Меня давно тут не было, меня мало кто вспомнит, но тем не менее.<br />
<br />
Использовать <a href="https://www.docker.com/" target="_blank">docker-контейнеры</a> на продакшене сейчас модно - удобно поддерживать, удобно разворачивать, удобно передавать. В своей работе пришлось столкнуться с задачей обернуть стандартный samp03svr в контейнер. Чужих реализаций не искал (вернее, посмотрел потом, все равно не устроили), сделал свою.<br />
<br />
Что нужно для запуска:<ul><li>понимать, что такое docker и зачем он нужен;</li>
<li><a href="https://www.docker.com/" target="_blank">docker</a>;</li>
<li><a href="https://docs.docker.com/compose/" target="_blank">docker-compose</a> (на самом деле, можно без него, но с ним удобнее);</li>
<li>git</li>
</ul>
Что входит в контейнер:<ul><li>Основной образ - Ubuntu 18.04 (ubuntu:bionic) с добавленной архитектурой i386 (dpkg --add-architecture i386);</li>
<li><a href="https://github.com/just-containers/s6-overlay" target="_blank">s6 overlay</a> для нормального автостарта samp03svr вместе с запуском контейнера;</li>
<li>libstdc++6 для корректного запуска бинарника samp03svr.</li>
</ul>
Инструкция по запуску:<ul><li>склонировать содержимое <a href="https://github.com/SHOROOP/docker-samp03svr" target="_blank">репозитория на Github</a>;</li>
<li>если необходимо - поправить Dockerfile (об этом - ниже в примечаниях);</li>
<li>положить в etc/ фильтрскрипты/плагины/гейммоды/server.cfg с сохранением иерархии (ГМы - в etc/gamemodes, ФС - в etc/filterscripts и т.д).;</li>
<li>запустить в папке с проектом docker-compose build;</li>
<li>поднять контейнер через docker-compose up -d.</li>
</ul>
Примечания:<ul><li>Качать архив с sa-mp.com необязательно. При сборке контейнера утягивается соответствующий тарболл. Если нужно поменять версию сервера - в Dockerfile поправьте 35 (URL, откуда будет загружаться архив) и 38 (имя скачанного архива) строки;</li>
<li>В etc/ можно положить хоть весь дистрибутив сервера целиком, вместе с бинарниками, и теоретически это даже должно работать (chmod +x идет уже после копирования в контейнер содержимого etc/). Но за работоспособность такого решения я не отвечаю;</li>
<li>В контейнере нет ничего лишнего, поэтому использование собранных динамически (dynamic linked) so-шек может быть невозможно. Используйте статически собранные или правьте Dockerfile, чтобы при сборке контейнера ставились недостающие пакеты;</li>
<li>Чтобы чистый сервер запускался, в Dockerfile на лету sed-ом заменяется rcon_password (если там стоит changeme, процесс попросту завершается). Если в etc/ лежит нужный server.cfg - из Dockerfile перед сборкой можно удалить строки 7, 8, 46 и 47;</li>
<li>Чтобы подебажить что-то на лету - влетайте в контейнер через docker exec -it <i>%ИмяКонтейнера%</i> /bin/bash, но учтите, что изменения потеряются после остановки контейнера;</li>
<li>server_log.txt внутри контейнера проброшен в /dev/stdout, если при падении процесса samp03svr упадет и контейнер - логи можно получить из docker logs. Если в etc/ будет лежать файл server_log.txt - при сборке образа он будет удален;</li>
<li>при любом изменении содержимого папки etc/ придется пересобирать контейнер через docker-compose build --no-cache. </li>
</ul>
Сборка делалась по большей части как proof-of-concept, но уже в таком виде работоспособна. В качестве теста поднял на 185.50.25.31:7777 чистый сервер с Grand Larceny. Форкать и допиливать можно и нужно, абсолютно не факт, что я буду вообще это поддерживать.]]></description>
			<content:encoded><![CDATA[Всем привет. Меня давно тут не было, меня мало кто вспомнит, но тем не менее.<br />
<br />
Использовать <a href="https://www.docker.com/" target="_blank">docker-контейнеры</a> на продакшене сейчас модно - удобно поддерживать, удобно разворачивать, удобно передавать. В своей работе пришлось столкнуться с задачей обернуть стандартный samp03svr в контейнер. Чужих реализаций не искал (вернее, посмотрел потом, все равно не устроили), сделал свою.<br />
<br />
Что нужно для запуска:<ul><li>понимать, что такое docker и зачем он нужен;</li>
<li><a href="https://www.docker.com/" target="_blank">docker</a>;</li>
<li><a href="https://docs.docker.com/compose/" target="_blank">docker-compose</a> (на самом деле, можно без него, но с ним удобнее);</li>
<li>git</li>
</ul>
Что входит в контейнер:<ul><li>Основной образ - Ubuntu 18.04 (ubuntu:bionic) с добавленной архитектурой i386 (dpkg --add-architecture i386);</li>
<li><a href="https://github.com/just-containers/s6-overlay" target="_blank">s6 overlay</a> для нормального автостарта samp03svr вместе с запуском контейнера;</li>
<li>libstdc++6 для корректного запуска бинарника samp03svr.</li>
</ul>
Инструкция по запуску:<ul><li>склонировать содержимое <a href="https://github.com/SHOROOP/docker-samp03svr" target="_blank">репозитория на Github</a>;</li>
<li>если необходимо - поправить Dockerfile (об этом - ниже в примечаниях);</li>
<li>положить в etc/ фильтрскрипты/плагины/гейммоды/server.cfg с сохранением иерархии (ГМы - в etc/gamemodes, ФС - в etc/filterscripts и т.д).;</li>
<li>запустить в папке с проектом docker-compose build;</li>
<li>поднять контейнер через docker-compose up -d.</li>
</ul>
Примечания:<ul><li>Качать архив с sa-mp.com необязательно. При сборке контейнера утягивается соответствующий тарболл. Если нужно поменять версию сервера - в Dockerfile поправьте 35 (URL, откуда будет загружаться архив) и 38 (имя скачанного архива) строки;</li>
<li>В etc/ можно положить хоть весь дистрибутив сервера целиком, вместе с бинарниками, и теоретически это даже должно работать (chmod +x идет уже после копирования в контейнер содержимого etc/). Но за работоспособность такого решения я не отвечаю;</li>
<li>В контейнере нет ничего лишнего, поэтому использование собранных динамически (dynamic linked) so-шек может быть невозможно. Используйте статически собранные или правьте Dockerfile, чтобы при сборке контейнера ставились недостающие пакеты;</li>
<li>Чтобы чистый сервер запускался, в Dockerfile на лету sed-ом заменяется rcon_password (если там стоит changeme, процесс попросту завершается). Если в etc/ лежит нужный server.cfg - из Dockerfile перед сборкой можно удалить строки 7, 8, 46 и 47;</li>
<li>Чтобы подебажить что-то на лету - влетайте в контейнер через docker exec -it <i>%ИмяКонтейнера%</i> /bin/bash, но учтите, что изменения потеряются после остановки контейнера;</li>
<li>server_log.txt внутри контейнера проброшен в /dev/stdout, если при падении процесса samp03svr упадет и контейнер - логи можно получить из docker logs. Если в etc/ будет лежать файл server_log.txt - при сборке образа он будет удален;</li>
<li>при любом изменении содержимого папки etc/ придется пересобирать контейнер через docker-compose build --no-cache. </li>
</ul>
Сборка делалась по большей части как proof-of-concept, но уже в таком виде работоспособна. В качестве теста поднял на 185.50.25.31:7777 чистый сервер с Grand Larceny. Форкать и допиливать можно и нужно, абсолютно не факт, что я буду вообще это поддерживать.]]></content:encoded>
		</item>
