			<title><![CDATA[[Include] TDW CJump - переходы между функциями]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=639095</link>
			<pubDate>Fri, 11 Aug 2017 13:56:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=261042">VVWVV</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=639095</guid>
			<description><![CDATA[<div align="center"><font color="orange"><font size="6">TDW CJump</font></font></div><b><font color="orange">Описание</font></b><blockquote>Добавляет возможность нелокальных переходов. В Pawn есть оператор goto, который позволяет перейти абсолютно в любое место в функции, однако с помощью данного оператора невозможен переход между функциями.</blockquote><b><font color="orange">Документация</font></b><blockquote>setjmp - функция, устанавливающая точку возврата. Данная функция записывает все значения из регистров, чтобы при вызове longjmp вернуть всё в исходное положение.<blockquote><b>Параметры:</b><ul><li>env[JmpBuf] - массив для хранения указателей.</li>
<li>&amp;retval - ссылка на переменную, в которую будет записано значение из функции longjmp.</li>
</ul></blockquote>longjmp - функция, переходящая на установленную точку: изменяет значения регистров на исходные.<blockquote><b>Параметры:</b><ul><li>env[JmpBuf] - массив для хранения указателей.</li>
<li>val - возвращаемое значение.</li>
</ul></blockquote><b>Пример использования функций:</b><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 274px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #007700">new </span><span style="color: #0000BB">jmp</span><span style="color: #007700">[</span><span style="color: #0000BB">JmpBuf</span><span style="color: #007700">];

<br/></span><span style="color: #0000BB">main</span><span style="color: #007700">() {
<br/>    new </span><span style="color: #0000BB">ret</span><span style="color: #007700">;
<br/>    </span><span style="color: #0000BB">setjmp</span><span style="color: #007700">(</span><span style="color: #0000BB">jmp</span><span style="color: #007700">, </span><span style="color: #0000BB">ret</span><span style="color: #007700">);

<br/>    if (</span><span style="color: #0000BB">ret </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">10</span><span style="color: #007700">) {
<br/>        </span><span style="color: #0000BB">somefunc</span><span style="color: #007700">(</span><span style="color: #0000BB">ret</span><span style="color: #007700">);
<br/>    }
<br/>}

<br/></span><span style="color: #0000BB">somefunc</span><span style="color: #007700">(</span><span style="color: #0000BB">ret</span><span style="color: #007700">)
<br/>{
<br/>    </span><span style="color: #0000BB">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"%d"</span><span style="color: #007700">, </span><span style="color: #0000BB">ret</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">longjmp</span><span style="color: #007700">(</span><span style="color: #0000BB">jmp</span><span style="color: #007700">, ++</span><span style="color: #0000BB">ret</span><span style="color: #007700">);
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div></blockquote><b><font color="orange">Скачать</font></b><blockquote><a href="https://github.com/TDW-org/samp-include-cjump" target="_blank"><b><u>github</u></b></a></blockquote><b><font color="orange">Установка</font></b><ol style="list-style-type: decimal"><li>Перейдите в репозиторий на github (ссылка выше).</li>
<li>Для скачивания на открывшейся странице нажмите на кнопку "Clone or download" (зелёного цвета) и в открывшемся меню - "Download ZIP".</li>
<li>Все файлы библиотеки перемести в папку '/pawno/includes/'.</li>
<li>Скомпилировать изменённые вами скрипты.</li>
</ol><blockquote>Автор: <a href="http://pro-pawn.ru/member.php?4348" target="_blank"><u>VVWVV</u></a><br />
Распространяется по лицензии zlib.</blockquote>]]></description>
			<content:encoded><![CDATA[<div align="center"><font color="orange"><font size="6">TDW CJump</font></font></div><b><font color="orange">Описание</font></b><blockquote>Добавляет возможность нелокальных переходов. В Pawn есть оператор goto, который позволяет перейти абсолютно в любое место в функции, однако с помощью данного оператора невозможен переход между функциями.</blockquote><b><font color="orange">Документация</font></b><blockquote>setjmp - функция, устанавливающая точку возврата. Данная функция записывает все значения из регистров, чтобы при вызове longjmp вернуть всё в исходное положение.<blockquote><b>Параметры:</b><ul><li>env[JmpBuf] - массив для хранения указателей.</li>
