			<title><![CDATA[[Tutorial] Как создать плагин [часть I]]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=630200</link>
			<pubDate>Sat, 11 Mar 2017 02:33:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=137522">Diman777</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=630200</guid>
			<description><![CDATA[<font size="6"><div align="center"><b>Как создать плагин</b></div></font><br />
<font size="5"><div align="center"><b><font color="Gray">часть I</font></b></div></font><br />
<font size="5">Введение</font><br />
Многим скриптерам интересно - Как же создаётся плагины для серверов? <img alt="" border="0" class="inlineimg" src="images/smilies/confused.png" title="Confused"/> В этот руководстве я расскажу один из простых способов как это сделать.<br />
Туториал расчитан на тех, кто знает язык Pawn, C++ (как минимум на начальном этапе) и хотя бы немного слышал что такое <a href="https://ru.wikipedia.org/wiki/Интегрированная_среда_разработки" target="_blank">Среда Разработки</a>.<br />
Если у Вас есть проблемы свыше перечисленным, то это тема будет бесполезна. Я сам по себе далеко не профессионал, поэтому буду рассказывать как получается. В 1-ой часте туториала мы разберём 'Как с самого начала создать плагин, и запустить его в моде'.<br />
<br />
<font size="5">Начало</font><br />
Плагин (англ. <i>plug-in</i>, от <i>plug in</i> «подключать») - это независимо компилируемый программный модуль, динамически подключаемый к основной программе. Основное предназначение в нашем случае - это расширение возможностей игрового мода. Благодаря этому можно сделать функционал, который <u>невозможно</u> сделать скриптово в моде на языке Pawn. Например можно сделать функцию, которая разрешит заходить на сервер с ником на кириллице. Или сделать так, чтобы сообщения в консоли были разными цветами.<br />
Перейдём к делу. Для создания плагина буду использовать  среду разработки <b><a href="https://ru.wikipedia.org/wiki/Microsoft_Visual_Studio" target="_blank">Microsoft Visual Studio 2015</a></b>.<br />
<div align="center"><img alt="" border="0" src="http://savepic.net/10139392.png"/></div>Если у Вас нет этой студии, то найдите на торрентах и скачайте (ссылку оставлю в самом низу туториала). Руководство пишется именно для версии 2015, поэтому лучше юзайте именно эту версию, чтобы не было каких-то мелочных проблем (типа а у меня другая версия студии и там нет такой штуки в Меню и т.д.).<br />
<br />
<font size="5">Важно</font><br />
Нужно понять такую вещь, что свой первый плагин мы будем делать в виде библиотеки с расширением <b><font color="Red">dll</font></b>. Это означает, что этот самый плагин будет работать только на ОС Windows =&gt; он работает только на локальном сервере с вашего компьютера. Для того, чтобы он запустился у Вас на хостинге - его исходный код нужно будет компилировать на ОС Linux в формат <b><font color="Red">so</font></b>. MVS этим не занимается. Но эта совсем другая тема. Как это делается можно глянуть в этой <a href="https://sampforum.blast.hk/showthread.php?tid=131419" target="_blank">теме</a>.<br />
<br />
<font size="5">Пошаговая инструкция</font><br />
<b><font size="3">1.</font></b> В самом начале мы должны создать проект: Файл -&gt; Создать -&gt; Проект<br />
<br />
<img alt="" border="0" src="http://savepic.net/10119936.jpg"/><br />
<br />
<b><font size="3">2.</font></b> Выбираем шаблон: Установленные -&gt; Шаблоны -&gt; Visual C++ -&gt; Win32 -&gt; Проект Win32. Сразу после этого мы должны придумать имя нашему проекту|решению, в нашем случае пусть будет <b>MyPlugin</b>. Нажимаем OK (если Вас имя не устраивает, то вписывайте любое на усмотрение. Делайте его лучше коротким, запоминающимся, и чтобы оно не совпадало с другими Вашими проектами).<br />
<br />
<a href="http://savepic.net/10151680.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10151680m.jpg"/></a><br />
<br />
<b><font size="3">3.</font></b> Сразу после того как вы выполнили 2-ой шаг - автоматически откроется окно Мастера приложений Win32.<br />
<br />
cлева в меню мы выбираем 'Параметры приложения'<br />
<br />
<a href="http://savepic.net/10111744.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10111744m.jpg"/></a><br />
<br />
далее в 'Тип приложения' ставим галочку 'Библиотека DLL', в 'Дополнительные параметры' галочку 'Пустой проект'. Нажимаем 'Готово'.<br />
<br />
<a href="http://savepic.net/10103552.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10103552m.jpg"/></a><br />
<br />
Перед нами создан пустой проект. Слева Вы можете увидеть/ознакомиться с 'Обозревателем решения' нашего проекта. Это такая область, в которой будут храниться все исходники (.h, .c, .cpp и др.) проекта. Если по какой-то причине этого обозревателя не видно, то щёлкните вкладку Вид -&gt; Обозреватель решений.<br />
<font color="Silver">Не обязательно: В 'Обозревателе решений' можете удалить 2 фильтра 'Заголовочные файлы' и 'Файлы ресурсов'. Они в дальнейшем не понадобятся (щёлкните правой кнопкой по фильтрам и выберите Удалить).</font><br />
<br />
<a href="http://savepic.net/10102528.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10102528m.jpg"/></a><br />
<br />
<b><font size="3">4.</font></b> С этого момента мы переходим непосредственно к установке важных свойств для проекта MyPlugin. Создаём файл определения модуля: Щёлкаем по вкладке Отладка -&gt; Свойства проекта -&gt; Компоновщик -&gt; Ввод -&gt; Файл определения модуля. Вписываем имя, в нашем случае <b>MyPlugin.def</b> (.def - не входит в часть имени, это расширение для будущего файла. По Вашему желанию имя можете указать своё, на английском языке). Сохраняемся, нажав кнопки Применить и ОК.<br />
<br />
<a href="http://savepic.net/10105600.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10105600m.jpg"/></a><br />
<br />
Теперь необходимо создать сам файл: Обозреватель решений -&gt; Файлы исходного кода -&gt; Добавить -&gt; Создать Элемент -&gt; Файл определения модуля (.def) -&gt; Имя <b>MyPlugin.def</b> -&gt; Добавить.<br />
<br />
<a href="http://savepic.net/10093312.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10093312m.jpg"/></a><br />
<br />
Открываем созданный нами <b>MyPlugin.def</b> и прописываем следующие параметры, которые необходимы для компилятора при построении проекта (этап компоновки):<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">Code:</div>
<pre class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 194px;
		text-align: left;
		overflow: auto">// оператору LIBRARY даём понять, что имя плагина будет называться MyPlugin
// во избежание warning'ов компилятора - оставим имя как у решения
LIBRARY "MyPlugin"

// в EXPORTS указываем какие функции будут экспортироваться
EXPORTS
	Supports
	Load
	Unload
	AmxLoad
	AmxUnload</pre>
</div><img alt="" border="0" src="http://savepic.net/10098432.jpg"/><br />
<br />
<b><font size="3">5.</font></b> Следующим шагом будет - добавление комплекта средств разработки <b>SDK (Software Development Kit)</b>. На сколько я понял он специально поставляется от самих разработчиков SAMP, поэтому мы будем использовать именно его.<br />
В 'Обозревателе решений' щёлкните правой кнопкой по MyPlugin -&gt; Добавить -&gt; Новый фильтр. Переименовываем его в SDK. Далее <a href="https://www.dropbox.com/s/oh7sokccnnritcf/SDK.rar?dl=0" target="_blank">скачайте</a> сам SDK, и распакуйте его в папку с вашим проектом. Например у меня он расположен по адресу: C:\Users\Diman777\Documents\Visual Studio 2015\Projects\MyPlugin\MyPlugin. И последнее - это включение в проект нашего SDK: Обозреватель решений -&gt; SDK -&gt; Добавить -&gt; Существующий элемент -&gt; amxplugin.cpp -&gt; Добавить.<br />
<br />
<a href="http://savepic.net/10156803.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10156803m.jpg"/></a><br />
<br />
<b><font size="3">6.</font></b> Теперь можно приступить к добавлению файла, который будет в себе содержать <b>исходный код</b>. Это то самое место, где Вы будете писать свои функции, определять константы и т.д.<br />
В 'Обозревателе решений' найдите фильтр Файлы исходного кода -&gt; Добавить -&gt; Создать элемент -&gt; Файл C++ (.cpp) -&gt; Называем его <b>main</b> -&gt; Добавить.<br />
<br />
<a href="http://savepic.net/10142467.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10142467m.jpg"/></a><br />
<br />
В только что созданный <b>main.cpp</b> добавляем следующий код:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">#include "SDK/plugin.h"

<br/></span><span style="color: #0000BB">typedef void</span><span style="color: #007700">(*</span><span style="color: #0000BB">logprintf_t</span><span style="color: #007700">)(</span><span style="color: #0000BB">char</span><span style="color: #007700">* </span><span style="color: #0000BB">format</span><span style="color: #007700">, ...);

<br/></span><span style="color: #0000BB">logprintf_t logprintf</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">void </span><span style="color: #007700">**</span><span style="color: #0000BB">ppPluginData</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">extern void </span><span style="color: #007700">*</span><span style="color: #0000BB">pAMXFunctions</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT bool PLUGIN_CALL Load</span><span style="color: #007700">(</span><span style="color: #0000BB">void </span><span style="color: #007700">**</span><span style="color: #0000BB">ppData</span><span style="color: #007700">)
<br/>{
<br/>    </span><span style="color: #0000BB">pAMXFunctions </span><span style="color: #007700">= </span><span style="color: #0000BB">ppData</span><span style="color: #007700">[</span><span style="color: #0000BB">PLUGIN_DATA_AMX_EXPORTS</span><span style="color: #007700">];
<br/>    </span><span style="color: #0000BB">logprintf </span><span style="color: #007700">= (</span><span style="color: #0000BB">logprintf_t</span><span style="color: #007700">)</span><span style="color: #0000BB">ppData</span><span style="color: #007700">[</span><span style="color: #0000BB">PLUGIN_DATA_LOGPRINTF</span><span style="color: #007700">];
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT void PLUGIN_CALL Unload</span><span style="color: #007700">()
<br/>{
<br/>    
<br/>}

<br/></span><span style="color: #0000BB">AMX_NATIVE_INFO NATIVES_LIST</span><span style="color: #007700">[] =
<br/>{
<br/>    { </span><span style="color: #0000BB">0</span><span style="color: #007700">, </span><span style="color: #0000BB">0 </span><span style="color: #007700">}
<br/>};

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT unsigned int PLUGIN_CALL Supports</span><span style="color: #007700">()
<br/>{
<br/>    return </span><span style="color: #0000BB">SUPPORTS_VERSION </span><span style="color: #007700">| </span><span style="color: #0000BB">SUPPORTS_AMX_NATIVES</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT int PLUGIN_CALL AmxLoad</span><span style="color: #007700">(</span><span style="color: #0000BB">AMX </span><span style="color: #007700">*</span><span style="color: #0000BB">amx</span><span style="color: #007700">)
<br/>{
<br/>    return </span><span style="color: #0000BB">amx_Register</span><span style="color: #007700">(</span><span style="color: #0000BB">amx</span><span style="color: #007700">, </span><span style="color: #0000BB">NATIVES_LIST</span><span style="color: #007700">, -</span><span style="color: #0000BB">1</span><span style="color: #007700">);
<br/>}

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT int PLUGIN_CALL AmxUnload</span><span style="color: #007700">(</span><span style="color: #0000BB">AMX </span><span style="color: #007700">*</span><span style="color: #0000BB">amx</span><span style="color: #007700">)
<br/>{
<br/>    return </span><span style="color: #0000BB">AMX_ERR_NONE</span><span style="color: #007700">;
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Вы спросите - 'Почему именно такой код?'. Сразу всё объяснить крайне сложно, просто будем считать, что это <b>основа</b>. Практически любой плагин содержит в себе именно такой код. Но всё же вкратце могу объяснить некоторые моменты:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 402px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">// Подключение инклуда от SDK.
<br/>#include "SDK/plugin.h"

<br/>// Необходимые определения/объявления некоторых функций
<br/>// для дальнейшей работы с ними.
<br/></span><span style="color: #0000BB">typedef void</span><span style="color: #007700">(*</span><span style="color: #0000BB">logprintf_t</span><span style="color: #007700">)(</span><span style="color: #0000BB">char</span><span style="color: #007700">* </span><span style="color: #0000BB">format</span><span style="color: #007700">, ...);

<br/></span><span style="color: #0000BB">logprintf_t logprintf</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">void </span><span style="color: #007700">**</span><span style="color: #0000BB">ppPluginData</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">extern void </span><span style="color: #007700">*</span><span style="color: #0000BB">pAMXFunctions</span><span style="color: #007700">;

<br/></span><span style="color: #FF8000">// Экспортируемые функции. Это те ф-ии, которые перечислены
<br/>// в файле my_plugin.def (см. 4-ый шаг)
<br/></span><span style="color: #0000BB">Load</span><span style="color: #007700">(</span><span style="color: #0000BB">void </span><span style="color: #007700">**</span><span style="color: #0000BB">ppData</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">Unload</span><span style="color: #007700">();
<br/></span><span style="color: #0000BB">Supports</span><span style="color: #007700">();
<br/></span><span style="color: #0000BB">AmxLoad</span><span style="color: #007700">(</span><span style="color: #0000BB">AMX </span><span style="color: #007700">*</span><span style="color: #0000BB">amx</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">AmxUnload</span><span style="color: #007700">(</span><span style="color: #0000BB">AMX </span><span style="color: #007700">*</span><span style="color: #0000BB">amx</span><span style="color: #007700">);

<br/></span><span style="color: #FF8000">// Массив, содержащий список созданных Вами функций,
<br/>// которые будут выполняться плагином.
<br/></span><span style="color: #0000BB">NATIVES_LIST</span><span style="color: #007700">[] = {...}; 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div><b><font size="3">7.</font></b> Теперь осталось сделать отладку:<br />
<br />
перед началом отладки на панели инструментов найдите список выбора 'конфигурации решения' и выберите <b>Release</b><br />
<br />
<img alt="" border="0" src="http://savepic.net/10136323.jpg"/><br />
<br />
теперь проект готов к отладке: Отладка -&gt; Начать отладку<br />
<br />
<img alt="" border="0" src="http://savepic.net/10137347.jpg"/><br />
<br />
Если Вы все шаги сделали правильно, то в окне студии (обычно внизу) появится некий отчёт.<br />
При успешной сборке проекта будет явно написано, что ошибок и предупреждений нет:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">Code:</div>
<pre class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 178px;
		text-align: left;
		overflow: auto">1&gt;------ Сборка начата: проект: MyPlugin, Конфигурация: Release Win32 ------
1&gt;  main.cpp
1&gt;  amxplugin.cpp
1&gt;     Создается библиотека c:\users\diman777\documents\visual studio 2015\Projects\MyPlugin\Release\MyPlugin.lib и объект c:\users\diman777\documents\visual studio 2015\Projects\MyPlugin\Release\MyPlugin.exp
1&gt;  Создание кода
1&gt;  All 6 functions were compiled because no usable IPDB/IOBJ from previous compilation was found.
1&gt;  Создание кода завершено
1&gt;  MyPlugin.vcxproj -&gt; c:\users\diman777\documents\visual studio 2015\Projects\MyPlugin\Release\MyPlugin.dll
1&gt;  MyPlugin.vcxproj -&gt; c:\users\diman777\documents\visual studio 2015\Projects\MyPlugin\Release\MyPlugin.pdb (Full PDB)
========== Сборка: успешно: 1, с ошибками: 0, без изменений: 0, пропущено: 0 ==========</pre>
</div>
<font size="5">Результат</font><br />
Свой плагин можно будет найти в папке с проектами:<br />
<br />
<a href="http://savepic.net/10138371.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10138371m.jpg"/></a><br />
<br />
Чтобы убедиться в работоспособности - подключите его к моду и запустите samp-server.exe:<br />
<br />
<img alt="" border="0" src="http://savepic.net/10129155.jpg"/><br />
<br />
Т.к. мы не создавали своих функций, то плагин ничего не делает. Он только подгружается к серверу.<br />
<br />
<font size="5">Заключение</font><br />
В этой часте мы разобрали с самого начала 'Как создаются плагины для модов' в MVS. 2-ая часть будет посвящена созданию <u>простеньких функций</u> и вывод их в мод в <font color="Blue">native</font>. <img alt="" border="0" class="inlineimg" src="images/smilies/razz.gif" title="Tongue"/><br />
<br />
<font size="5">Полезные ссылки</font><ul><li><a href="http://maintracker.org/forum/viewtopic.php?t=5047529" target="_blank">MVS 2015 Professional</a></li>
<li><a href="https://www.dropbox.com/s/oh7sokccnnritcf/SDK.rar?dl=0" target="_blank">SDK (Software Development Kit)</a></li>
</ul>
<font size="5">Скачать</font><br />
Внизу во вложениях прикреплены плагин (.dll) и его исходники (.c, .h, .cpp, .def).]]></description>
			<content:encoded><![CDATA[<font size="6"><div align="center"><b>Как создать плагин</b></div></font><br />
<font size="5"><div align="center"><b><font color="Gray">часть I</font></b></div></font><br />
<font size="5">Введение</font><br />
Многим скриптерам интересно - Как же создаётся плагины для серверов? <img alt="" border="0" class="inlineimg" src="images/smilies/confused.png" title="Confused"/> В этот руководстве я расскажу один из простых способов как это сделать.<br />
Туториал расчитан на тех, кто знает язык Pawn, C++ (как минимум на начальном этапе) и хотя бы немного слышал что такое <a href="https://ru.wikipedia.org/wiki/Интегрированная_среда_разработки" target="_blank">Среда Разработки</a>.<br />
Если у Вас есть проблемы свыше перечисленным, то это тема будет бесполезна. Я сам по себе далеко не профессионал, поэтому буду рассказывать как получается. В 1-ой часте туториала мы разберём 'Как с самого начала создать плагин, и запустить его в моде'.<br />
<br />
<font size="5">Начало</font><br />
Плагин (англ. <i>plug-in</i>, от <i>plug in</i> «подключать») - это независимо компилируемый программный модуль, динамически подключаемый к основной программе. Основное предназначение в нашем случае - это расширение возможностей игрового мода. Благодаря этому можно сделать функционал, который <u>невозможно</u> сделать скриптово в моде на языке Pawn. Например можно сделать функцию, которая разрешит заходить на сервер с ником на кириллице. Или сделать так, чтобы сообщения в консоли были разными цветами.<br />
Перейдём к делу. Для создания плагина буду использовать  среду разработки <b><a href="https://ru.wikipedia.org/wiki/Microsoft_Visual_Studio" target="_blank">Microsoft Visual Studio 2015</a></b>.<br />
<div align="center"><img alt="" border="0" src="http://savepic.net/10139392.png"/></div>Если у Вас нет этой студии, то найдите на торрентах и скачайте (ссылку оставлю в самом низу туториала). Руководство пишется именно для версии 2015, поэтому лучше юзайте именно эту версию, чтобы не было каких-то мелочных проблем (типа а у меня другая версия студии и там нет такой штуки в Меню и т.д.).<br />
<br />
<font size="5">Важно</font><br />
Нужно понять такую вещь, что свой первый плагин мы будем делать в виде библиотеки с расширением <b><font color="Red">dll</font></b>. Это означает, что этот самый плагин будет работать только на ОС Windows =&gt; он работает только на локальном сервере с вашего компьютера. Для того, чтобы он запустился у Вас на хостинге - его исходный код нужно будет компилировать на ОС Linux в формат <b><font color="Red">so</font></b>. MVS этим не занимается. Но эта совсем другая тема. Как это делается можно глянуть в этой <a href="https://sampforum.blast.hk/showthread.php?tid=131419" target="_blank">теме</a>.<br />
<br />
<font size="5">Пошаговая инструкция</font><br />
<b><font size="3">1.</font></b> В самом начале мы должны создать проект: Файл -&gt; Создать -&gt; Проект<br />
<br />
<img alt="" border="0" src="http://savepic.net/10119936.jpg"/><br />
<br />
<b><font size="3">2.</font></b> Выбираем шаблон: Установленные -&gt; Шаблоны -&gt; Visual C++ -&gt; Win32 -&gt; Проект Win32. Сразу после этого мы должны придумать имя нашему проекту|решению, в нашем случае пусть будет <b>MyPlugin</b>. Нажимаем OK (если Вас имя не устраивает, то вписывайте любое на усмотрение. Делайте его лучше коротким, запоминающимся, и чтобы оно не совпадало с другими Вашими проектами).<br />
<br />
<a href="http://savepic.net/10151680.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10151680m.jpg"/></a><br />
<br />
<b><font size="3">3.</font></b> Сразу после того как вы выполнили 2-ой шаг - автоматически откроется окно Мастера приложений Win32.<br />
<br />
cлева в меню мы выбираем 'Параметры приложения'<br />
<br />
<a href="http://savepic.net/10111744.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10111744m.jpg"/></a><br />
<br />
далее в 'Тип приложения' ставим галочку 'Библиотека DLL', в 'Дополнительные параметры' галочку 'Пустой проект'. Нажимаем 'Готово'.<br />
<br />
<a href="http://savepic.net/10103552.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10103552m.jpg"/></a><br />
<br />
Перед нами создан пустой проект. Слева Вы можете увидеть/ознакомиться с 'Обозревателем решения' нашего проекта. Это такая область, в которой будут храниться все исходники (.h, .c, .cpp и др.) проекта. Если по какой-то причине этого обозревателя не видно, то щёлкните вкладку Вид -&gt; Обозреватель решений.<br />
<font color="Silver">Не обязательно: В 'Обозревателе решений' можете удалить 2 фильтра 'Заголовочные файлы' и 'Файлы ресурсов'. Они в дальнейшем не понадобятся (щёлкните правой кнопкой по фильтрам и выберите Удалить).</font><br />
<br />
<a href="http://savepic.net/10102528.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10102528m.jpg"/></a><br />
<br />
<b><font size="3">4.</font></b> С этого момента мы переходим непосредственно к установке важных свойств для проекта MyPlugin. Создаём файл определения модуля: Щёлкаем по вкладке Отладка -&gt; Свойства проекта -&gt; Компоновщик -&gt; Ввод -&gt; Файл определения модуля. Вписываем имя, в нашем случае <b>MyPlugin.def</b> (.def - не входит в часть имени, это расширение для будущего файла. По Вашему желанию имя можете указать своё, на английском языке). Сохраняемся, нажав кнопки Применить и ОК.<br />
<br />
<a href="http://savepic.net/10105600.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10105600m.jpg"/></a><br />
<br />
Теперь необходимо создать сам файл: Обозреватель решений -&gt; Файлы исходного кода -&gt; Добавить -&gt; Создать Элемент -&gt; Файл определения модуля (.def) -&gt; Имя <b>MyPlugin.def</b> -&gt; Добавить.<br />
<br />
<a href="http://savepic.net/10093312.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10093312m.jpg"/></a><br />
<br />
Открываем созданный нами <b>MyPlugin.def</b> и прописываем следующие параметры, которые необходимы для компилятора при построении проекта (этап компоновки):<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">Code:</div>
<pre class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 194px;
		text-align: left;
		overflow: auto">// оператору LIBRARY даём понять, что имя плагина будет называться MyPlugin
// во избежание warning'ов компилятора - оставим имя как у решения
LIBRARY "MyPlugin"

// в EXPORTS указываем какие функции будут экспортироваться
EXPORTS
	Supports
	Load
	Unload
	AmxLoad
	AmxUnload</pre>
</div><img alt="" border="0" src="http://savepic.net/10098432.jpg"/><br />
<br />
<b><font size="3">5.</font></b> Следующим шагом будет - добавление комплекта средств разработки <b>SDK (Software Development Kit)</b>. На сколько я понял он специально поставляется от самих разработчиков SAMP, поэтому мы будем использовать именно его.<br />
В 'Обозревателе решений' щёлкните правой кнопкой по MyPlugin -&gt; Добавить -&gt; Новый фильтр. Переименовываем его в SDK. Далее <a href="https://www.dropbox.com/s/oh7sokccnnritcf/SDK.rar?dl=0" target="_blank">скачайте</a> сам SDK, и распакуйте его в папку с вашим проектом. Например у меня он расположен по адресу: C:\Users\Diman777\Documents\Visual Studio 2015\Projects\MyPlugin\MyPlugin. И последнее - это включение в проект нашего SDK: Обозреватель решений -&gt; SDK -&gt; Добавить -&gt; Существующий элемент -&gt; amxplugin.cpp -&gt; Добавить.<br />
<br />
<a href="http://savepic.net/10156803.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10156803m.jpg"/></a><br />
<br />
<b><font size="3">6.</font></b> Теперь можно приступить к добавлению файла, который будет в себе содержать <b>исходный код</b>. Это то самое место, где Вы будете писать свои функции, определять константы и т.д.<br />
В 'Обозревателе решений' найдите фильтр Файлы исходного кода -&gt; Добавить -&gt; Создать элемент -&gt; Файл C++ (.cpp) -&gt; Называем его <b>main</b> -&gt; Добавить.<br />
<br />
<a href="http://savepic.net/10142467.htm" target="_blank"><img alt="" border="0" src="http://savepic.net/10142467m.jpg"/></a><br />
<br />
В только что созданный <b>main.cpp</b> добавляем следующий код:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">#include "SDK/plugin.h"

<br/></span><span style="color: #0000BB">typedef void</span><span style="color: #007700">(*</span><span style="color: #0000BB">logprintf_t</span><span style="color: #007700">)(</span><span style="color: #0000BB">char</span><span style="color: #007700">* </span><span style="color: #0000BB">format</span><span style="color: #007700">, ...);

<br/></span><span style="color: #0000BB">logprintf_t logprintf</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">void </span><span style="color: #007700">**</span><span style="color: #0000BB">ppPluginData</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">extern void </span><span style="color: #007700">*</span><span style="color: #0000BB">pAMXFunctions</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT bool PLUGIN_CALL Load</span><span style="color: #007700">(</span><span style="color: #0000BB">void </span><span style="color: #007700">**</span><span style="color: #0000BB">ppData</span><span style="color: #007700">)
<br/>{
<br/>    </span><span style="color: #0000BB">pAMXFunctions </span><span style="color: #007700">= </span><span style="color: #0000BB">ppData</span><span style="color: #007700">[</span><span style="color: #0000BB">PLUGIN_DATA_AMX_EXPORTS</span><span style="color: #007700">];
<br/>    </span><span style="color: #0000BB">logprintf </span><span style="color: #007700">= (</span><span style="color: #0000BB">logprintf_t</span><span style="color: #007700">)</span><span style="color: #0000BB">ppData</span><span style="color: #007700">[</span><span style="color: #0000BB">PLUGIN_DATA_LOGPRINTF</span><span style="color: #007700">];
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT void PLUGIN_CALL Unload</span><span style="color: #007700">()
<br/>{
<br/>    
<br/>}

<br/></span><span style="color: #0000BB">AMX_NATIVE_INFO NATIVES_LIST</span><span style="color: #007700">[] =
<br/>{
<br/>    { </span><span style="color: #0000BB">0</span><span style="color: #007700">, </span><span style="color: #0000BB">0 </span><span style="color: #007700">}
<br/>};

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT unsigned int PLUGIN_CALL Supports</span><span style="color: #007700">()
<br/>{
<br/>    return </span><span style="color: #0000BB">SUPPORTS_VERSION </span><span style="color: #007700">| </span><span style="color: #0000BB">SUPPORTS_AMX_NATIVES</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT int PLUGIN_CALL AmxLoad</span><span style="color: #007700">(</span><span style="color: #0000BB">AMX </span><span style="color: #007700">*</span><span style="color: #0000BB">amx</span><span style="color: #007700">)
<br/>{
<br/>    return </span><span style="color: #0000BB">amx_Register</span><span style="color: #007700">(</span><span style="color: #0000BB">amx</span><span style="color: #007700">, </span><span style="color: #0000BB">NATIVES_LIST</span><span style="color: #007700">, -</span><span style="color: #0000BB">1</span><span style="color: #007700">);
<br/>}

<br/></span><span style="color: #0000BB">PLUGIN_EXPORT int PLUGIN_CALL AmxUnload</span><span style="color: #007700">(</span><span style="color: #0000BB">AMX </span><span style="color: #007700">*</span><span style="color: #0000BB">amx</span><span style="color: #007700">)
<br/>{
<br/>    return </span><span style="color: #0000BB">AMX_ERR_NONE</span><span style="color: #007700">;
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Вы спросите - 'Почему именно такой код?'. Сразу всё объяснить крайне сложно, просто будем считать, что это <b>основа</b>. Практически любой плагин содержит в себе именно такой код. Но всё же вкратце могу объяснить некоторые моменты:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 402px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">// Подключение инклуда от SDK.
<br/>#include "SDK/plugin.h"

