			<title><![CDATA[[Include] TDW String Library]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=622918</link>
			<pubDate>Sun, 27 Nov 2016 22:33:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=261042">VVWVV</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=622918</guid>
			<description><![CDATA[<div align="center">
<font size="5">TDW String Library</font><br />
<a href="https://github.com/TDW-org/samp-include-string/" target="_blank">github</a><br />
</div>
<b><font size="4">Описание:</font></b><blockquote>Добавляет большое количество новых функций для работы со строками. Все функции поддерживают упакованные строки!</blockquote><b><font size="4">Функции:</font></b><blockquote>
<br />
<b>Erase:</b><br />
<br />
erase_first(string[], const find[], bool:ignorecase = false, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает <i>первую</i> найденную подстроку(find) из строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке.</blockquote></blockquote>erase_last(string[], const find[], bool:ignorecase = false);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает <i>последнюю</i> найденную подстроку(find) из строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке.</blockquote></blockquote>erase_nth(string[], const find[], n, bool:ignorecase = false, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает 'n' найденных подстрок</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-1</blockquote></blockquote>erase(string[], start_pos, length = cellmax);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает определённое количество символов, заданных в start_pos(начало) и length(количество символов).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-1</blockquote></blockquote>
<b>Find:</b><br />
<br />
find_first(const string[], const find[], bool:ignorecase = false, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет подстроку(find) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке, в противном случае -1</blockquote></blockquote>find_last(const string[], const find[], bool:ignorecase = false);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет последнюю найденную подстроку(find) из строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке, в противном случае -1</blockquote></blockquote>find_first_of(const string[], const charlist[], pos_string = 0, size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ из массива(charlist) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа в строке, в противном случае -1</blockquote></blockquote>find_last_of(const string[], const charlist[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ из массива(charlist) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа с конца строки, в противном случае -1</blockquote></blockquote>find_first_not_of(const string[], const charlist[], pos_string = 0, size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ <i>не</i> из массива(charlist) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа в строке, в противном случае -1</blockquote></blockquote>find_last_not_of(const string[], const charlist[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ <i>не</i> из массива(charlist) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа в строке, в противном случае -1</blockquote></blockquote><b>Replace:</b><br />
<br />
replace_first(string[], const find[], const replace[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет первую найденную подстроку(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote>replace_last(string[], const find[], const replace[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет последнюю найденную подстроку(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote>replace_nth(string[], const find[], const replace[], n, bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет 'n' найденных подстрок(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote>replace_all(string[], const find[], const replace[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет все подстроки(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote><b>Trim:</b><br />
<br />
trim_left(string[], const delimiter = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с начала строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_right(string[], const delimiter = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim(string[], const delimiter = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с двух сторон строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_leftex(string[], const delimiters = !" ");<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiters) с начала строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_rightex(string[], const delimiters = !" ");<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiters) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_ex(string[], const delimiters = !" ");<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с двух сторон строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote><b>Полезные:</b><br />
<br />
IsPackedString(string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Определяет формат записи строки в памяти.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если строка упакована, в противном случае - false</blockquote></blockquote>IsEmptyString(const string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote></blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если строка пустая, в противном случае - false</blockquote></blockquote>strcount(const string[], const find[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подсчитывает количество подстрок(find) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Количество вложенных подстрок</blockquote></blockquote>strreverse(string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Переворачивает строку.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>strparttoupper(string[], part_start, part_end, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Данная функция изменяет строчные буквы на заглавные на отдельных участках строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>strparttolower(string[], part_start, part_end, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Данная функция изменяет заглавные на строчные буквы на отдельных участках строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>countofuppercase(const string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подсчитывают количество заглавных букв в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>число (процент)</blockquote></blockquote>countoflowpercase(const string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подсчитывают количество строчных букв в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>число (процент)</blockquote></blockquote>strtrtrans(string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Переводит русские символы в транслитерацию.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>islowerpart(const string[], start_part_pos, end_part_pos);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Проверяет отдельный участок кода на наличие символов в нижним регистре.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если в отдельный участке все символы в нижним регистре, иначе false.</blockquote></blockquote>isupperpart(const string[], start_part_pos, end_part_pos);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Проверяет отдельный участок кода на наличие символов в верхнем регистре.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если в отдельный участке все символы в верхнем регистре, иначе false.</blockquote></blockquote>strcatex(dest[], size, const ...);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Соединяет строки друг с другом по средством strcat.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает количество символов.</blockquote></blockquote>strfill(string[], const pattern[] = " ", fill_length, E_TDW_FILL_TYPE:type = FILL_TYPE_BOTH, size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заполняет строку указанной подстрокой.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает 1, если fill_length меньше чем size, иначе 0.</blockquote></blockquote>strimplodeex(dest[], const delimiter[] = !" ", dest_size = sizeof dest, const ...);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заполняет строки с разделителем(delimiter).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Количество символов (без размера разделителя).</blockquote></blockquote>strimplode(dest[], const arrays[][], const delimiter[] = !" ", array_items = sizeof arrays, dest_size = sizeof dest);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Тоже самое, что и strimplodeex, однако значения берутся из массива.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>strsplit(dest[], const string[], &amp;index, const seperator = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подобие strtok, но в более лучшем виде. Примечание: не работает с упакованными строками.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>replace_symbol(string[], const _char, replace, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет один символ в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>replace_symbols(string[], const _char, replace, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет  символы в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote></blockquote><b><font size="4">Скачать:</font></b><blockquote><font size="3"><a href="https://github.com/TDW-org/samp-include-string/" target="_blank">github</a></font></blockquote><b><font size="4">Установка:</font></b><ol style="list-style-type: decimal"><li>Скачать библиотеку.</li>
<li>Все файлы, точнее библиотеки, переместить в папку 'pawno/includes'. Впрочем, можно воспользоваться флагом '-i&lt;путь&gt;' для указания альтернативного пути для библиотек.</li>
<li>Библиотеки необходимо подключать после файла 'a_samp'.<br />
Пример:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">pawn Code:</div>
<pre class="alt2" style="margin:0px; padding:6px; border: 1px solid #C2C2C2; width:800px; height:55px; overflow:auto"><div dir="ltr" style="text-align:left;"><div class="pawn" style="font-family:monospace;"><span style="color: #2222AA;">#include &lt;a_samp&gt;</span><br/><span style="color: #2222AA;">#include &lt;tdw_string&gt;</span></div></div></pre>
</div></li>
<li>Скомпилировать изменённые вами скрипты.</li>
</ol>
<b><font size="4">Благодарности:</font></b><ul><li>Untonyst</li>
<li>Nexius</li>
<li>ziggi</li>
<li>DeimoS</li>
<li>Stepashka</li>
</ul>
Распространяется по лицензии ZLIB.]]></description>
			<content:encoded><![CDATA[<div align="center">
<font size="5">TDW String Library</font><br />
<a href="https://github.com/TDW-org/samp-include-string/" target="_blank">github</a><br />
</div>
<b><font size="4">Описание:</font></b><blockquote>Добавляет большое количество новых функций для работы со строками. Все функции поддерживают упакованные строки!</blockquote><b><font size="4">Функции:</font></b><blockquote>
<br />
<b>Erase:</b><br />
<br />
erase_first(string[], const find[], bool:ignorecase = false, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает <i>первую</i> найденную подстроку(find) из строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке.</blockquote></blockquote>erase_last(string[], const find[], bool:ignorecase = false);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает <i>последнюю</i> найденную подстроку(find) из строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке.</blockquote></blockquote>erase_nth(string[], const find[], n, bool:ignorecase = false, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает 'n' найденных подстрок</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-1</blockquote></blockquote>erase(string[], start_pos, length = cellmax);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Вырезает определённое количество символов, заданных в start_pos(начало) и length(количество символов).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-1</blockquote></blockquote>
<b>Find:</b><br />
<br />
find_first(const string[], const find[], bool:ignorecase = false, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет подстроку(find) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке, в противном случае -1</blockquote></blockquote>find_last(const string[], const find[], bool:ignorecase = false);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет последнюю найденную подстроку(find) из строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию начала подстроки в строке, в противном случае -1</blockquote></blockquote>find_first_of(const string[], const charlist[], pos_string = 0, size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ из массива(charlist) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа в строке, в противном случае -1</blockquote></blockquote>find_last_of(const string[], const charlist[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ из массива(charlist) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа с конца строки, в противном случае -1</blockquote></blockquote>find_first_not_of(const string[], const charlist[], pos_string = 0, size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ <i>не</i> из массива(charlist) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа в строке, в противном случае -1</blockquote></blockquote>find_last_not_of(const string[], const charlist[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Ищет первый попавшийся символ <i>не</i> из массива(charlist) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Позицию первого попавшегося символа в строке, в противном случае -1</blockquote></blockquote><b>Replace:</b><br />
<br />
replace_first(string[], const find[], const replace[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет первую найденную подстроку(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote>replace_last(string[], const find[], const replace[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет последнюю найденную подстроку(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote>replace_nth(string[], const find[], const replace[], n, bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет 'n' найденных подстрок(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote>replace_all(string[], const find[], const replace[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет все подстроки(find) строкой(replace).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Если строка найдена - 1, в противном случае 0.</blockquote></blockquote><b>Trim:</b><br />
<br />
trim_left(string[], const delimiter = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с начала строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_right(string[], const delimiter = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim(string[], const delimiter = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с двух сторон строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_leftex(string[], const delimiters = !" ");<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiters) с начала строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_rightex(string[], const delimiters = !" ");<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiters) с конца строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>trim_ex(string[], const delimiters = !" ");<blockquote><b><font size="2">Описание</font></b>:<blockquote>Обрезает символы(delimiter) с двух сторон строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote><b>Полезные:</b><br />
<br />
IsPackedString(string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Определяет формат записи строки в памяти.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если строка упакована, в противном случае - false</blockquote></blockquote>IsEmptyString(const string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote></blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если строка пустая, в противном случае - false</blockquote></blockquote>strcount(const string[], const find[], bool:ignorecase = false, pos = 0, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подсчитывает количество подстрок(find) в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Количество вложенных подстрок</blockquote></blockquote>strreverse(string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Переворачивает строку.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>strparttoupper(string[], part_start, part_end, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Данная функция изменяет строчные буквы на заглавные на отдельных участках строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>strparttolower(string[], part_start, part_end, string_size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Данная функция изменяет заглавные на строчные буквы на отдельных участках строки.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>countofuppercase(const string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подсчитывают количество заглавных букв в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>число (процент)</blockquote></blockquote>countoflowpercase(const string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подсчитывают количество строчных букв в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>число (процент)</blockquote></blockquote>strtrtrans(string[]);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Переводит русские символы в транслитерацию.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>islowerpart(const string[], start_part_pos, end_part_pos);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Проверяет отдельный участок кода на наличие символов в нижним регистре.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если в отдельный участке все символы в нижним регистре, иначе false.</blockquote></blockquote>isupperpart(const string[], start_part_pos, end_part_pos);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Проверяет отдельный участок кода на наличие символов в верхнем регистре.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает true, если в отдельный участке все символы в верхнем регистре, иначе false.</blockquote></blockquote>strcatex(dest[], size, const ...);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Соединяет строки друг с другом по средством strcat.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает количество символов.</blockquote></blockquote>strfill(string[], const pattern[] = " ", fill_length, E_TDW_FILL_TYPE:type = FILL_TYPE_BOTH, size = sizeof string);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заполняет строку указанной подстрокой.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Возвращает 1, если fill_length меньше чем size, иначе 0.</blockquote></blockquote>strimplodeex(dest[], const delimiter[] = !" ", dest_size = sizeof dest, const ...);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заполняет строки с разделителем(delimiter).</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>Количество символов (без размера разделителя).</blockquote></blockquote>strimplode(dest[], const arrays[][], const delimiter[] = !" ", array_items = sizeof arrays, dest_size = sizeof dest);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Тоже самое, что и strimplodeex, однако значения берутся из массива.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>strsplit(dest[], const string[], &amp;index, const seperator = ' ');<blockquote><b><font size="2">Описание</font></b>:<blockquote>Подобие strtok, но в более лучшем виде. Примечание: не работает с упакованными строками.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>replace_symbol(string[], const _char, replace, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет один символ в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote>replace_symbols(string[], const _char, replace, pos = 0);<blockquote><b><font size="2">Описание</font></b>:<blockquote>Заменяет  символы в строке.</blockquote><b><font size="2">Возвращает</font></b>:<blockquote>-</blockquote></blockquote></blockquote><b><font size="4">Скачать:</font></b><blockquote><font size="3"><a href="https://github.com/TDW-org/samp-include-string/" target="_blank">github</a></font></blockquote><b><font size="4">Установка:</font></b><ol style="list-style-type: decimal"><li>Скачать библиотеку.</li>
<li>Все файлы, точнее библиотеки, переместить в папку 'pawno/includes'. Впрочем, можно воспользоваться флагом '-i&lt;путь&gt;' для указания альтернативного пути для библиотек.</li>
<li>Библиотеки необходимо подключать после файла 'a_samp'.<br />
Пример:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">pawn Code:</div>
<pre class="alt2" style="margin:0px; padding:6px; border: 1px solid #C2C2C2; width:800px; height:55px; overflow:auto"><div dir="ltr" style="text-align:left;"><div class="pawn" style="font-family:monospace;"><span style="color: #2222AA;">#include &lt;a_samp&gt;</span><br/><span style="color: #2222AA;">#include &lt;tdw_string&gt;</span></div></div></pre>
</div></li>
<li>Скомпилировать изменённые вами скрипты.</li>
</ol>
<b><font size="4">Благодарности:</font></b><ul><li>Untonyst</li>
<li>Nexius</li>
<li>ziggi</li>
<li>DeimoS</li>
<li>Stepashka</li>
</ul>
Распространяется по лицензии ZLIB.]]></content:encoded>
