			<title><![CDATA[[Plugin] Advanced SA NickName (ASAN) - Лучший плагин Русских Ников]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=617993</link>
			<pubDate>Thu, 29 Sep 2016 14:44:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=187588">KrYpToDeN</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=617993</guid>
			<description><![CDATA[Приветствую всех.<br />
<br />
Хочу предложить Вам плагин, позволяющий заходить на сервер с расширенными правилами никнейма.<br />
<br />
<font size="3">Название плагина:</font><br />
<b><u>Advanced-SA-NickName (сокращенно ASAN)</u></b>.<br />
<br />
<font size="3">Актуальная версия:</font><br />
<b><u>5.0</u></b>.<br />
<br />
<font size="3">Главные особенности плагина:</font><br />
<ul><li>Используйте свои символы в никнеймах (установите правила через регулярные выражения (Regex)).</li>
</ul><ul><li>Используйте повторные никнеймы (более чем один одинаковый ник) на Вашем сервере.</li>
</ul><ul><li>Используйте длину ника, отличную от стандартной (1 - 24 символа).</li>
</ul><ul><li>Заменяйте символы нижнего подчеркивания (_) на символы пробела ( ) перед подключением игрока.</li>
</ul><ul><li>Вам не нужно менять адреса памяти при переходе на новую версию SA:MP сервера. Плагин всё сделает за Вас.</li>
</ul><ul><li>Любые манипуляции с плагином происходят в файле конфигураций scriptfiles/ASAN_Config.ini (создается при первом запуске плагина).</li>
</ul><ul><li>Есть множество дополнительных функций для Вашего никнейма в файле конфигураций.</li>
</ul><ul><li>Плагин работает и я надеюсь будет работать на любой версии SA:MP, начиная с SA:MP 0.3C R5.</li>
</ul><ul><li>Есть несколько дополнительных функций для Вашего Pawn кода, чтобы контролировать никнеймы.</li>
</ul><ul><li>Большая просьба. Прочтите инструкции, указанные в архиве.</li>
</ul><ul><li>На данный момент багов не обнаружено!</li>
</ul>
<b>Обязательно посмотрите и настройте под себя файл конфигураций после создания!</b><br />
<br />
<font size="3">Создатель:</font><ul><li>[KrYpToDeN]</li>
</ul><font size="3">Благодарности:</font><ul><li>Большое спасибо [EC]Zero за помощь с нахождением адресов памяти и реализации автоматического нахождения адресов для плагина версии 1.0!</li>
</ul><ul><li>Большое спасибо Enrique_Heimonen за помощь в тестировании!</li>
</ul><ul><li>Большое спасибо ZiGGi за помощь в нахождении адреса памяти для повторных никнеймов!</li>
</ul>
Приятного использования <img alt="" border="0" class="inlineimg" src="images/smilies/smile.png" title="Smiley"/><br />
<br />
<b><font size="3">Ссылка на скачивание исходного кода + релиза (для Windows + Linux), а также инструкция в прилегающей ссылке:<br />
<br />
<a href="https://github.com/KrYpToDeN/Advanced-SA-NickName/releases" target="_blank">Ссылка на релиз на GitHub</a></font></b><br />
<br />
Сборка для OS Centos и OS Debian будет добавлена скоро!<br />
<br />
<img alt="" border="0" src="https://a.radikal.ru/a03/1801/2c/4532fa7da4f1.png"/><br />
<br />
<img alt="" border="0" src="https://c.radikal.ru/c18/1801/89/0ce17403bbc1.png"/>]]></description>
			<content:encoded><![CDATA[Приветствую всех.<br />
