			<title><![CDATA[[Plugin] rustext - русификация игрового текста для множества русификаторов]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=617345</link>
			<pubDate>Mon, 19 Sep 2016 20:59:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=36935">ZiGGi</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=617345</guid>
			<description><![CDATA[<div align="center"><font size="6">rustext</font><br />
<a href="https://github.com/ziggi/rustext" target="_blank">GitHub</a></div>
<font size="6">Описание</font><br />
Плагин заменяет символы, передаваемые функциями для работы с TextDraw, Menu и GameText на те, что соответствуют русификатору. Русификатор по умолчанию - SanLtd, но вы можете каждому игроку установить собственный русификатор.<br />
<br />
<font size="6">Использование</font><br />
Просто скопируйте плагин в директорию <b>plugins/</b> вашего сервера и добавьте <b>rustext[.so]</b> (в зависимости от платформы) к ключу <b>plugins</b> в ваш <b>server.cfg</b>. Если вы хотите получить дополнительный функционал, то скопируйте <b>rustext.inc</b> в вашу директорию с библиотеками и добавьте <b>#include "rustext"</b> в ваш скрипт.<br />
<br />
<font size="6">Типы русификаторов</font><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP код:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 226px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB">enum RussifierType </span><span style="color: #007700">{
<br/>    </span><span style="color: #0000BB">RussifierType_Disabled </span><span style="color: #007700">= -</span><span style="color: #0000BB">1</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_SanLtd </span><span style="color: #007700">= </span><span style="color: #0000BB">0</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_OneC</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Rush</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Unknown1</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Unknown2</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Unknown3</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_MG</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Community</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Ukrainian</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Hungarian</span><span style="color: #007700">,
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Версии Unknown - это русификаторы в стиле "ПОТРАЧЕНО", просто мне не удалось определить их автора или названия (один из них от Фаргуса, но непонятно какой).<br />
<br />
<font size="6">Примеры</font><br />
Здесь показана работа с русификатором SanLtd:<br />
<img alt="" border="0" src="https://cloud.githubusercontent.com/assets/1020099/18914954/db9b4ade-8597-11e6-8d72-783cfd24fb99.png"/><br />
Здесь показана работа с украинской локализацией:<br />
<img alt="" border="0" src="https://cloud.githubusercontent.com/assets/1020099/18914955/db9d95dc-8597-11e6-9c2b-6ae5cc05bc72.png"/><br />
<br />
<font size="6">Функции</font><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP код:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 98px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB">native SetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">type</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">native RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">GetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);

<br/></span><span style="color: #0000BB">native SetDefaultRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">type</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">native RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">GetDefaultRussifierType</span><span style="color: #007700">(); 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div><font size="6">Пример использования</font><br />
Система настройки русификатора для игрока.<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP код:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">#include &lt;a_samp&gt;
<br/>#include &lt;rustext&gt;

<br/></span><span style="color: #007700">static
<br/>    </span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">];

<br/>const
<br/>    </span><span style="color: #0000BB">Float</span><span style="color: #007700">:</span><span style="color: #0000BB">TEXT_BASE_X </span><span style="color: #007700">= </span><span style="color: #0000BB">150.0</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">Float</span><span style="color: #007700">:</span><span style="color: #0000BB">TEXT_BASE_Y </span><span style="color: #007700">= </span><span style="color: #0000BB">150.0</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT </span><span style="color: #007700">= </span><span style="color: #0000BB">7</span><span style="color: #007700">; </span><span style="color: #FF8000">// only Russian localizations

<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnGameModeInit</span><span style="color: #007700">()
<br/>{
<br/>    for (new </span><span style="color: #0000BB">i</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT</span><span style="color: #007700">; </span><span style="color: #0000BB">i</span><span style="color: #007700">++) {
<br/>        </span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">] = </span><span style="color: #0000BB">_</span><span style="color: #007700">:</span><span style="color: #0000BB">TextDrawCreate</span><span style="color: #007700">(</span><span style="color: #0000BB">TEXT_BASE_X</span><span style="color: #007700">,
<br/>                                                      </span><span style="color: #0000BB">TEXT_BASE_Y </span><span style="color: #007700">+ </span><span style="color: #0000BB">15.0 </span><span style="color: #007700">* </span><span style="color: #0000BB">i</span><span style="color: #007700">,
<br/>                                                      </span><span style="color: #DD0000">"Я могу прочитать этот текст, это мой русификатор"</span><span style="color: #007700">);
<br/>        </span><span style="color: #0000BB">TextDrawSetSelectable</span><span style="color: #007700">(</span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">], </span><span style="color: #0000BB">1</span><span style="color: #007700">);
<br/>        </span><span style="color: #0000BB">TextDrawTextSize</span><span style="color: #007700">(</span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">], </span><span style="color: #0000BB">600.0</span><span style="color: #007700">, </span><span style="color: #0000BB">10.0</span><span style="color: #007700">);
<br/>    }
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/>public </span><span style="color: #0000BB">OnPlayerSpawn</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">)
<br/>{
<br/>    for (new </span><span style="color: #0000BB">i</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT</span><span style="color: #007700">; </span><span style="color: #0000BB">i</span><span style="color: #007700">++) {
<br/>        </span><span style="color: #0000BB">SetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">);
<br/>        </span><span style="color: #0000BB">TextDrawShowForPlayer</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">]);
<br/>    }
<br/>    </span><span style="color: #0000BB">SelectTextDraw</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">0xAA3333FF</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/>public </span><span style="color: #0000BB">OnPlayerClickTextDraw</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">clickedid</span><span style="color: #007700">)
<br/>{
<br/>    for (new </span><span style="color: #0000BB">i</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT</span><span style="color: #007700">; </span><span style="color: #0000BB">i</span><span style="color: #007700">++) {
<br/>        if (</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">] == </span><span style="color: #0000BB">_</span><span style="color: #007700">:</span><span style="color: #0000BB">clickedid</span><span style="color: #007700">) {
<br/>            </span><span style="color: #0000BB">SetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">);
<br/>            </span><span style="color: #0000BB">CancelSelectTextDraw</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);
<br/>        }
<br/>        </span><span style="color: #0000BB">TextDrawHideForPlayer</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">]);
<br/>    }
<br/>    return </span><span style="color: #0000BB">0</span><span style="color: #007700">;
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Или вы можете использовать библиотеку <a href="https://github.com/Open-GTO/russifier" target="_blank">russifier</a>:<br />
<br />
<img alt="" border="0" src="https://user-images.githubusercontent.com/1020099/42131912-a08b08b8-7d15-11e8-93f6-aa0478d4b095.png"/><br />
<br />
<font size="6">Русификаторы</font><ul><li>Все поддерживаемые руссификаторы можно скачать <a href="https://mega.nz/#F!tVhlhDCT!FK1xFcBalTA0ySY_JsryMg" target="_blank">здесь</a>, названия файлов соответствуют названиям в плагине.</li>
</ul>
<font size="6">Скачать</font><ul><li>Последнюю версию вы всегда можете найти на <a href="https://github.com/ziggi/rustext/releases" target="_blank">странице релизов GitHub</a>.</li>
</ul>]]></description>
			<content:encoded><![CDATA[<div align="center"><font size="6">rustext</font><br />
<a href="https://github.com/ziggi/rustext" target="_blank">GitHub</a></div>
<font size="6">Описание</font><br />
Плагин заменяет символы, передаваемые функциями для работы с TextDraw, Menu и GameText на те, что соответствуют русификатору. Русификатор по умолчанию - SanLtd, но вы можете каждому игроку установить собственный русификатор.<br />
<br />
<font size="6">Использование</font><br />
Просто скопируйте плагин в директорию <b>plugins/</b> вашего сервера и добавьте <b>rustext[.so]</b> (в зависимости от платформы) к ключу <b>plugins</b> в ваш <b>server.cfg</b>. Если вы хотите получить дополнительный функционал, то скопируйте <b>rustext.inc</b> в вашу директорию с библиотеками и добавьте <b>#include "rustext"</b> в ваш скрипт.<br />
<br />
<font size="6">Типы русификаторов</font><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP код:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 226px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB">enum RussifierType </span><span style="color: #007700">{
<br/>    </span><span style="color: #0000BB">RussifierType_Disabled </span><span style="color: #007700">= -</span><span style="color: #0000BB">1</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_SanLtd </span><span style="color: #007700">= </span><span style="color: #0000BB">0</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_OneC</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Rush</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Unknown1</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Unknown2</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Unknown3</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_MG</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Community</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Ukrainian</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">RussifierType_Hungarian</span><span style="color: #007700">,
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Версии Unknown - это русификаторы в стиле "ПОТРАЧЕНО", просто мне не удалось определить их автора или названия (один из них от Фаргуса, но непонятно какой).<br />
<br />
<font size="6">Примеры</font><br />
Здесь показана работа с русификатором SanLtd:<br />
<img alt="" border="0" src="https://cloud.githubusercontent.com/assets/1020099/18914954/db9b4ade-8597-11e6-8d72-783cfd24fb99.png"/><br />
Здесь показана работа с украинской локализацией:<br />
<img alt="" border="0" src="https://cloud.githubusercontent.com/assets/1020099/18914955/db9d95dc-8597-11e6-9c2b-6ae5cc05bc72.png"/><br />
<br />
<font size="6">Функции</font><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP код:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 98px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB">native SetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">type</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">native RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">GetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);

<br/></span><span style="color: #0000BB">native SetDefaultRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">type</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">native RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">GetDefaultRussifierType</span><span style="color: #007700">(); 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div><font size="6">Пример использования</font><br />
Система настройки русификатора для игрока.<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP код:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">#include &lt;a_samp&gt;
<br/>#include &lt;rustext&gt;

<br/></span><span style="color: #007700">static
<br/>    </span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">];

<br/>const
<br/>    </span><span style="color: #0000BB">Float</span><span style="color: #007700">:</span><span style="color: #0000BB">TEXT_BASE_X </span><span style="color: #007700">= </span><span style="color: #0000BB">150.0</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">Float</span><span style="color: #007700">:</span><span style="color: #0000BB">TEXT_BASE_Y </span><span style="color: #007700">= </span><span style="color: #0000BB">150.0</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT </span><span style="color: #007700">= </span><span style="color: #0000BB">7</span><span style="color: #007700">; </span><span style="color: #FF8000">// only Russian localizations

<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnGameModeInit</span><span style="color: #007700">()
<br/>{
<br/>    for (new </span><span style="color: #0000BB">i</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT</span><span style="color: #007700">; </span><span style="color: #0000BB">i</span><span style="color: #007700">++) {
<br/>        </span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">] = </span><span style="color: #0000BB">_</span><span style="color: #007700">:</span><span style="color: #0000BB">TextDrawCreate</span><span style="color: #007700">(</span><span style="color: #0000BB">TEXT_BASE_X</span><span style="color: #007700">,
<br/>                                                      </span><span style="color: #0000BB">TEXT_BASE_Y </span><span style="color: #007700">+ </span><span style="color: #0000BB">15.0 </span><span style="color: #007700">* </span><span style="color: #0000BB">i</span><span style="color: #007700">,
<br/>                                                      </span><span style="color: #DD0000">"Я могу прочитать этот текст, это мой русификатор"</span><span style="color: #007700">);
<br/>        </span><span style="color: #0000BB">TextDrawSetSelectable</span><span style="color: #007700">(</span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">], </span><span style="color: #0000BB">1</span><span style="color: #007700">);
<br/>        </span><span style="color: #0000BB">TextDrawTextSize</span><span style="color: #007700">(</span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">], </span><span style="color: #0000BB">600.0</span><span style="color: #007700">, </span><span style="color: #0000BB">10.0</span><span style="color: #007700">);
<br/>    }
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/>public </span><span style="color: #0000BB">OnPlayerSpawn</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">)
<br/>{
<br/>    for (new </span><span style="color: #0000BB">i</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT</span><span style="color: #007700">; </span><span style="color: #0000BB">i</span><span style="color: #007700">++) {
<br/>        </span><span style="color: #0000BB">SetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">);
<br/>        </span><span style="color: #0000BB">TextDrawShowForPlayer</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">]);
<br/>    }
<br/>    </span><span style="color: #0000BB">SelectTextDraw</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">0xAA3333FF</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/>public </span><span style="color: #0000BB">OnPlayerClickTextDraw</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">clickedid</span><span style="color: #007700">)
<br/>{
<br/>    for (new </span><span style="color: #0000BB">i</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">TEXT_RUSSIFIERS_COUNT</span><span style="color: #007700">; </span><span style="color: #0000BB">i</span><span style="color: #007700">++) {
<br/>        if (</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">] == </span><span style="color: #0000BB">_</span><span style="color: #007700">:</span><span style="color: #0000BB">clickedid</span><span style="color: #007700">) {
<br/>            </span><span style="color: #0000BB">SetPlayerRussifierType</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">);
<br/>            </span><span style="color: #0000BB">CancelSelectTextDraw</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);
<br/>        }
<br/>        </span><span style="color: #0000BB">TextDrawHideForPlayer</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Text</span><span style="color: #007700">:</span><span style="color: #0000BB">TextRusTD</span><span style="color: #007700">[</span><span style="color: #0000BB">RussifierType</span><span style="color: #007700">:</span><span style="color: #0000BB">i</span><span style="color: #007700">]);
<br/>    }
<br/>    return </span><span style="color: #0000BB">0</span><span style="color: #007700">;
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
