			<title><![CDATA[[FilterScript] Подвижные метки игроков на карте в зоне 51]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=611821</link>
			<pubDate>Mon, 11 Jul 2016 09:24:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=169845">Bombo</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=611821</guid>
			<description><![CDATA[<div align="center"><b><font color="Red"><font size="5">Метки игроков в зоне 51</font></font></b></div>
<font size="4"><br />
Автор: <font color="Green"><b>Bombo</b></font><br />
Версия: <font color="Magenta"><b>2.0</b></font></font><br />
<br />
<br />
<font size="2">Версия <i>2.0</i><br />
<b>[+]</b> Ники игроков<br />
<b>[@]</b> Исправлен баг с неправильным положением маркера<br />
<b>[@]</b> Исправлен баг при обновлении отображения маркеров</font><br />
<br />
<br />
Версия 2.0<br />
<img alt="" border="0" src="http://botinform.asuscomm.com/pics/markers_forum1.png"/><br />
<br />
Версия 1.0<br />
<img alt="" border="0" src="http://botinform.asuscomm.com/pics/markers_forum.png"/><br />
<br />
<font size="3">Длинный маркер - игрок<br />
Короткий маркер - NPC</font><br />
<br />
v2.0<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">//Map markers by Bombo
<br/>//v2.0

<br/>#define FILTERSCRIPT

<br/>#include &lt;a_samp&gt;
<br/>#include &lt;streamer&gt;

<br/>#define ZONE_MARK_INTERVAL 5000

<br/></span><span style="color: #007700">new </span><span style="color: #0000BB">gPlayerMarker</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYERS</span><span style="color: #007700">];
<br/>new </span><span style="color: #0000BB">Text3D</span><span style="color: #007700">:</span><span style="color: #0000BB">gMarkerText</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYERS</span><span style="color: #007700">];
<br/>new </span><span style="color: #0000BB">gTimerPlayerZoneMark</span><span style="color: #007700">;

<br/></span><span style="color: #0000BB">forward update_player_zone_mark</span><span style="color: #007700">();

<br/></span><span style="color: #FF8000">#if defined FILTERSCRIPT

<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnFilterScriptInit</span><span style="color: #007700">()
<br/>{
<br/>    new </span><span style="color: #0000BB">i</span><span style="color: #007700">;
<br/>    
<br/>    print(</span><span style="color: #DD0000">"\n--------------------------------------"</span><span style="color: #007700">);
<br/>    print(</span><span style="color: #DD0000">" Map markers in Area 51 by Bombo"</span><span style="color: #007700">);
<br/>    print(</span><span style="color: #DD0000">"--------------------------------------\n"</span><span style="color: #007700">);

<br/>    for(</span><span style="color: #0000BB">i </span><span style="color: #007700">= </span><span style="color: #0000BB">0</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">MAX_PLAYERS</span><span style="color: #007700">; ++</span><span style="color: #0000BB">i</span><span style="color: #007700">)
<br/>    {
<br/>        </span><span style="color: #0000BB">gPlayerMarker</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">] = </span><span style="color: #0000BB">INVALID_OBJECT_ID</span><span style="color: #007700">;
<br/>    }
<br/>    
<br/>    </span><span style="color: #0000BB">gTimerPlayerZoneMark </span><span style="color: #007700">= </span><span style="color: #0000BB">SetTimer</span><span style="color: #007700">(</span><span style="color: #DD0000">"update_player_zone_mark"</span><span style="color: #007700">, </span><span style="color: #0000BB">ZONE_MARK_INTERVAL</span><span style="color: #007700">, </span><span style="color: #0000BB">true</span><span style="color: #007700">);

<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/>public </span><span style="color: #0000BB">OnFilterScriptExit</span><span style="color: #007700">()
<br/>{
<br/>    new </span><span style="color: #0000BB">i</span><span style="color: #007700">;
<br/>    
<br/>    </span><span style="color: #0000BB">KillTimer</span><span style="color: #007700">(</span><span style="color: #0000BB">gTimerPlayerZoneMark</span><span style="color: #007700">);

<br/>    for(</span><span style="color: #0000BB">i </span><span style="color: #007700">= </span><span style="color: #0000BB">0</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">MAX_PLAYERS</span><span style="color: #007700">; ++</span><span style="color: #0000BB">i</span><span style="color: #007700">)
<br/>    {
<br/>        if(</span><span style="color: #0000BB">gPlayerMarker</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">] != </span><span style="color: #0000BB">INVALID_OBJECT_ID</span><span style="color: #007700">)
<br/>        {
<br/>            </span><span style="color: #0000BB">DestroyDynamicObject</span><span style="color: #007700">(</span><span style="color: #0000BB">gPlayerMarker</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">]);
<br/>            </span><span style="color: #0000BB">gPlayerMarker</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">] = </span><span style="color: #0000BB">INVALID_OBJECT_ID</span><span style="color: #007700">;
<br/>            if(!</span><span style="color: #0000BB">IsPlayerNPC</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">))
<br/>            {
<br/>                if(</span><span style="color: #0000BB">IsValidDynamic3DTextLabel</span><span style="color: #007700">(</span><span style="color: #0000BB">gMarkerText</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">]))
<br/>                    </span><span style="color: #0000BB">DestroyDynamic3DTextLabel</span><span style="color: #007700">(</span><span style="color: #0000BB">gMarkerText</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">]);
<br/>            }
<br/>        }
<br/>    }
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">#else

<br/></span><span style="color: #0000BB">main</span><span style="color: #007700">()
<br/>{
<br/>    print(</span><span style="color: #DD0000">"\n----------------------------------"</span><span style="color: #007700">);
<br/>    print(</span><span style="color: #DD0000">" Map markers in Area 51 by Bombo"</span><span style="color: #007700">);
<br/>    print(</span><span style="color: #DD0000">"----------------------------------\n"</span><span style="color: #007700">);
<br/>}

<br/></span><span style="color: #FF8000">#endif

<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnGameModeInit</span><span style="color: #007700">()
<br/>{
